                                        <th style={{ fontWeight: "bold", textAlign: "center" }}>Amount
                                            <tr className='border-top d-flex justify-content-between'>
                                                <div className='w-75 border-right ml-2'>
                                                    <td>Groos Sales</td>
                                                </div>
